(1419, '__construct', 0, 'Constructor.\n \n$config is an array of key/value pairs\ncontaining configuration options.These options are common to most adapters:\n \ndbname => (string) The name of the database to user\nusername => (string) Connect to the database as this username.\npassword => (string) Password associated with the username.\nhost => (string) What host to connect to, defaults to localhost\n \nSome options are used on a case-by-case basis by adapters:\n \nport => (string) The port of the database\npersistent => (boolean) Whether to use a persistent connection or not, defaults to false\nprotocol => (string) The network protocol, defaults to TCPIP\ncaseFolding=> (int) style of case-alteration used for identifiers', 'Zend_Db_Adapter_Exception', '7f11f42d552af55f76b4b28f130830c4', 0, 0, 'public', 3, '', 'ecc04a75d4bfb387ff22cb3f2a6a3aa4', 0, 0, 0, 17847),
