(1419, 'describeTable', 0, 'Returns the column descriptions for a table.\n \nThe return value is an associative array keyed by the column name,\nas returned by the RDBMS.\n \nThe value of each array element is an associative array\nwith the following keys:\n \nSCHEMA_NAME=> string; name of database or schema\nTABLE_NAME => string;\nCOLUMN_NAME=> string; column name\nCOLUMN_POSITION=> number; ordinal position of column in table\nDATA_TYPE=> string; SQL datatype name of column\nDEFAULT=> string; default expression of column, null if none\nNULLABLE => boolean; true if column can have nulls\nLENGTH => number; length of CHAR/VARCHAR\nSCALE=> number; scale of NUMERIC/DECIMAL\nPRECISION=> number; precision of NUMERIC/DECIMAL\nUNSIGNED => boolean; unsigned property of an integer type\nPRIMARY=> boolean; true if column is part of the primary key\nPRIMARY_POSITION => integer; position of column in primary key\nIDENTITY => integer; true if column is auto-generated with unique values', '', 'c6fc64c4db04a35f412ce93c556f4f21', 0, 0, 'public', 3, 'array', 'ecc04a75d4bfb387ff22cb3f2a6a3aa4', 0, 1, 0, 17858),
