(1419, 'lastInsertId', 0, 'Gets the last ID generated automatically by an IDENTITY/AUTOINCREMENT column.\n \nAs a convention, on RDBMS brands that support sequences\n(e.g. Oracle, PostgreSQL, DB2), this method forms the name of a sequence\nfrom the arguments and returns the last id generated by that sequence.\nOn RDBMS brands that support IDENTITY/AUTOINCREMENT columns, this method\nreturns the last value generated for such a column, and the table name\nargument is disregarded.\n \nMySQL does not support sequences, so $tableName and $primaryKey are ignored.', '', 'bc0704b0300cae00151e347c125673ad', 0, 0, 'public', 3, 'string', 'ecc04a75d4bfb387ff22cb3f2a6a3aa4', 0, 1, 0, 17862),
