(1419, 'fetchAll', 0, 'Fetches all SQL result rows as a sequential array.\nUses the current fetchMode for the adapter.', '', '28e9f72b60efafde629dbe73ed9d06fc', 0, 0, 'public', 3, 'array', 'ecc04a75d4bfb387ff22cb3f2a6a3aa4', 0, 1, 0, 17884),
(1419, 'fetchRow', 0, 'Fetches the first row of the SQL result.\nUses the current fetchMode for the adapter.', '', 'db7b1f42ff72a7ceeffc70764ea11ef8', 0, 0, 'public', 3, 'array', 'ecc04a75d4bfb387ff22cb3f2a6a3aa4', 0, 1, 0, 17885),
(1419, 'fetchAssoc', 0, 'Fetches all SQL result rows as an associative array.\n \nThe first column is the key, the entire row array is the\nvalue.You should construct the query to be sure that\nthe first column contains unique values, or else\nrows with duplicate values in the first column will\noverwrite previous data.', '', '6e932dae724960ecfe8642c8ebead301', 0, 0, 'public', 3, 'array', 'ecc04a75d4bfb387ff22cb3f2a6a3aa4', 0, 1, 0, 17886),
(1419, 'fetchCol', 0, 'Fetches the first column of all SQL result rows as an array.', '', 'db41de5af44eee48888c0474274dadaf', 0, 0, 'public', 3, 'array', 'ecc04a75d4bfb387ff22cb3f2a6a3aa4', 0, 1, 0, 17887),
(1419, 'fetchPairs', 0, 'Fetches all SQL result rows as an array of key-value pairs.\n \nThe first column is the key, the second column is the\nvalue.', '', '50c1bed59c12f0ef43d8304bb4507b1d', 0, 0, 'public', 3, 'array', 'ecc04a75d4bfb387ff22cb3f2a6a3aa4', 0, 1, 0, 17888),
(1419, 'fetchOne', 0, 'Fetches the first column of the first row of the SQL result.', '', 'b1ed582d34b32a5a8d541e4c4ca33e05', 0, 0, 'public', 3, 'string', 'ecc04a75d4bfb387ff22cb3f2a6a3aa4', 0, 1, 0, 17889),
(1419, 'quote', 0, 'Safely quotes a value for an SQL statement.\n \nIf an array is passed as the value, the array values are quoted\nand then returned as a comma-separated string.', '', '2357ca68d005cf791838f9432760fb1a', 0, 0, 'public', 3, 'mixed An SQL-safe quoted value (or string of separated values).', 'ecc04a75d4bfb387ff22cb3f2a6a3aa4', 0, 1, 0, 17890),
(1419, 'quoteInto', 0, 'Quotes a value and places into a piece of text at a placeholder.\n \nThe placeholder is a question-mark; all placeholders will be replaced\nwith the quoted value. For example:\n \n\n$text = &#34;WHERE date quoteInto($text, $date);\n// $safe = &#34;WHERE date ', '', '54cf8719eb238b6a7832b28a2867efaa', 0, 0, 'public', 3, 'string An SQL-safe quoted value placed into the original text.', 'ecc04a75d4bfb387ff22cb3f2a6a3aa4', 0, 1, 0, 17891),
(1419, 'quoteIdentifier', 0, 'Quotes an identifier.\n \nAccepts a string representing a qualified indentifier. For Example:\n\n$adapter->quoteIdentifier(&#39;myschema.mytable&#39;)\n\nReturns: &#34;myschema&#34;.&#34;mytable&#34;\n \nOr, an array of one or more identifiers that may form a qualified identifier:\n\n$adapter->quoteIdentifier(array(&#39;myschema&#39;,&#39;my.table&#39;))\n\nReturns: &#34;myschema&#34;.&#34;my.table&#34;\n \nThe actual quote character surrounding the identifiers may vary depending on\nthe adapter.', '', '10dfcc1966701f9b6be3665eb27c5fb2', 0, 0, 'public', 3, 'string The quoted identifier.', 'ecc04a75d4bfb387ff22cb3f2a6a3aa4', 0, 1, 0, 17892),
(1419, 'quoteColumnAs', 0, 'Quote a column identifier and alias.', '', 'ca40acbe5e352d39be75d609eec9c2dc', 0, 0, 'public', 3, 'string The quoted identifier and alias.', 'ecc04a75d4bfb387ff22cb3f2a6a3aa4', 0, 1, 0, 17893),
(1419, 'quoteTableAs', 0, 'Quote a table identifier and alias.', '', 'b9500f3a9c286578030ab5a17699ceab', 0, 0, 'public', 3, 'string The quoted identifier and alias.', 'ecc04a75d4bfb387ff22cb3f2a6a3aa4', 0, 1, 0, 17894),
(1419, 'lastSequenceId', 0, 'Return the most recent value from the specified sequence in the database.\nThis is supported only on RDBMS brands that support sequences\n(e.g. Oracle, PostgreSQL, DB2).Other RDBMS brands return null.', '', 'e564cf0cd5ec28498c9d36ccf15ea630', 0, 0, 'public', 3, 'string', 'ecc04a75d4bfb387ff22cb3f2a6a3aa4', 0, 1, 0, 17895),
