('ru', 'description', 983, 'Базовый класс для блоков', 3, 'sysdocs_class', 'afa41c6d5ef6f566e1e1fa5bf158cff8', 1437),
('ru', 'description', 984, 'Базовый класс маршрутизации клиентских запросов (DVelum 0.9 и выше)', 3, 'sysdocs_class', 'c129b5c49263b3e9e4aecd6ddfa3a629', 1438),
('ru', 'description', 986, 'Класс для работы со словарями (списки ключ &ndash; значение, ключ уникальный)', 3, 'sysdocs_class', 'b4831c43e357b3b4baab71eae6151d1d', 1439),
('ru', 'description', 987, 'Приложение – это основной класс, который инициализирует системные настройки, работа системы начинается с запуска объекта этого класса.', 3, 'sysdocs_class', 'c3ac7e36824a64b0fdd8233ad8598d9c', 1440),
('ru', 'description', 988, 'Менеджер событий объектов ORM (Db_Object)', 3, 'sysdocs_class', 'fa6ab5f198b2dc5eef96a11480184cae', 1441),
('ru', 'description', 989, '<p>Используется для идентификации текущего пользователя системы.</p>\n\n<p>Добавление и редактирование пользователей производится при помощи ORM. Получение информации о пользователях осуществляется при помощи модели User.</p>\n<p>Пример:</p>\n<pre>\n<code>\n$user = new Db_Object(&#39;user&#39;);\n$date = date(&#39;Y-m-d H:i:s&#39;);\n$user-&gt;setValues(\n     array(\n		&#39;name&#39; =&gt;&#39;User Name&#39;,\n		&#39;email&#39; =&gt; &#39;user@gmail.com&#39;,\n		&#39;login&#39; =&gt; &#39;userlogin&#39;,\n		&#39;pass&#39; =&gt; Utils::hash(&#39;userpassword&#39;),\n		&#39;enabled&#39; =&gt; true,\n		&#39;admin&#39; =&gt; false,\n		&#39;registration_date&#39; =&gt; $date ,\n		&#39;confirmation_code&#39; =&gt; &#39;&#39; ,\n		&#39;group_id&#39; =&gt; 0,\n		&#39;confirmed&#39; =&gt; true,\n		&#39;avatar&#39; =&gt; &#39;&#39;,\n		&#39;registration_ip&#39; =&gt; $_SERVER[&#39;REMOTE_ADDR&#39;],\n		&#39;last_ip&#39; =&gt; $_SERVER[&#39;REMOTE_ADDR&#39;],\n		&#39;confirmation_date&#39; =&gt;$date\n	)\n);\n$userId = $user-&gt;save();\n</code></pre>', 3, 'sysdocs_class', '8cdaf616166c8a3fc2e2a63442048adc', 1442),
('ru', 'description', 991, 'Используется для сбора свойств отображаемой страницы (контейнер данных).\nРеализует паттерн “Одиночка” доступен из любого места приложения в единственном экземпляре.', 3, 'sysdocs_class', '20d4b6cb3809890521f1bdc1ee506ec9', 1443),
('ru', 'description', 995, 'Маршрутизатор клиентских запросов публичной части (DVelum 0.9 и выше)', 3, 'sysdocs_class', 'a4048710d11d8609edf66b980ee1f661', 1444),
('ru', 'description', 997, 'Абстрактный класс контроллера, используется для организации доступа авторизованых пользователей к модулю публичной части сайта (доступно с версии 0.9.2).\n\nЕсли вы хотите закрыть часть публичного интерфейса формой авторизации пользователя, отнаследуйте свой контроллер от этого класса.\n\nДополнительных настроек не требуется, контроллер сам определит, авторизирован ли пользователь, в случае необходимости выведет форму авторизации.', 3, 'sysdocs_class', '6569e8aad67393e241bdfc40ef758ad5', 1445),
('ru', 'description', 998, 'Абстрактный класс контроллера, используется для отображения проектов дизайнера интерфейсов в публичной части сайта (вывод административных модулей во фронтенд). Для использования требует наличие административных прав у пользователя, выводит форму авторизации (доступно с версии 0.9.2).', 3, 'sysdocs_class', '27e2deb1b6c0bc20d684bdaa79cc0aa3', 1446),
('ru', 'description', 999, 'Базовый котроллер для публичной части сайта', 3, 'sysdocs_class', '6294a2850630940ed02ee28132a35f42', 1447),
('ru', 'description', 1000, 'Обертка для Zend_Mail, анализирует текст письма, находит тег img, создает inline вложения изображений.', 3, 'sysdocs_class', '56969d23362db7f273af03d4a835d2f2', 1448),
('ru', 'description', 1069, 'Базовый класс для cсоздания контроллеров административных интерфейсов CRUD (создание редактирование обновление удаление) для объектов ORM (DVelum 0.9 и выше)', 3, 'sysdocs_class', '60f0a2bf53ef82897d1a3f7e874ed832', 1449),
('ru', 'description', 1070, 'Базовый класс для cоздания контроллеров административных интерфейсов CRUD (создание редактирование обновление удаление) для объектов ORM (DVelum 0.9 и выше)', 3, 'sysdocs_class', '27b940e510fbafaf4863ca271d85910b', 1450),
('ru', 'description', 1094, '<p>Базовый класс триггеров ORM (запускаются на уровне кода PHP) Выполняется во всех DB_Object. Триггеры для конкретных объектов ORM должны располагаться в папке system/app/Trigger</p>\n\n<p>Например:<br />\nsystem/app/Trigger/Page.php содержащий<br />\nclass Trigger_Page extends Trigger<br />\nБудет выполняться при изменениях в объектах Page (new Db_Object(&#39;Page&#39;))</p>', 3, 'sysdocs_class', '572a3c39f37408068997e79b0d32e13d', 1451),
('ru', 'description', 1096, 'Абстрактный класс Controller\nБазовый класс для реализации контроллеров (DVelum 0.9 и выше)', 3, 'sysdocs_class', '01a970727ce8d4d6d641256aad731de4', 1452),
('ru', 'description', 1105, 'Служит для управления блоками содержания страницы, осуществляет подгрузку классов, рендеринг, кэширование, инфалидацию кэша блоков.', 3, 'sysdocs_class', '9ab764d70f2788dc2bf4a7a93c3260a0', 1453),
('ru', 'description', 1106, '<p>Класс локализации приложения. Используется для создания многоязычных приложений а также для вынесения текстовых констант из кода.</p>\n\n<p><strong>Пример использования</strong><strong>:</strong></p>\n\n<p><span style="font-size:10px;"><span style="color: rgb(255, 0, 0);"><strong>&lt;?php</strong></span></span><br />\n<span style="font-size:10px;"><span style="color: rgb(106, 49, 10);">$lang</span> = <span style="color:#000000;">Lang::<em>lang</em>();</span></span><br />\n<span style="font-size:10px;"><span style="color: rgb(0, 0, 255);"><strong>echo </strong></span><span style="color: rgb(106, 49, 10);">$lang</span>-&gt;<span style="color: rgb(0, 0, 255);"><em>NAME</em></span>;</span><br />\n<span style="font-size:10px;"><span style="color:#0000CD;">echo</span> <span style="color:#8B4513;">$lang</span>-&gt;<span style="color:#000000;">get</span>(<span style="color:#006400;">&#39;NAME</span>&#39;);</span></p>\n\n<p><span style="font-size:12px;">Система автоматически выбирает словарь локализации, основываясь на файле конфигурации системы.</span></p>\n', 3, 'sysdocs_class', 'ea97d4402631faa638ba278597c0dae0', 1454),
