('ru', 'description', 1137, 'Частный случай адаптера загрузки файлов - загрузка изображений. После загрузки файла запускает нарезку превью по заданному списку размеров', 3, 'sysdocs_class', '8c10963da71c291b8191195decac1516', 1467),
('ru', 'description', 1138, 'Адаптер для загрузки файлов', 3, 'sysdocs_class', 'd742223374ee7467a000a25e5022c7dc', 1468),
('ru', 'description', 1145, 'Класс проекта дизайнера интерфейсов. Предоставляет API интерфейс для хранения настроек компонент. Файл проекта содержит сериализованный объект этого класса.', 3, 'sysdocs_class', 'ae61db3997c7469648383732812e3cf8', 1469),
('ru', 'description', 1147, 'Отладчик проекта дизайнера интерфейсов', 3, 'sysdocs_class', 'eca7e910f526fb20ccbe8fa0895ab107', 1470),
('ru', 'description', 1374, 'Загрузчик файлов', 3, 'sysdocs_class', '9b112526f0fea5abb07df8827776897a', 1471),
('ru', 'description', 1379, '<p>Класс для работы с древовидными структурами, оптимизирован под высокую производительность, работу с большим количеством вложенных узлов, без труда способен обработать дерево с 25000 &mdash; 30000 элементами менее чем за 1 секунду.</p>\n<pre><h4>Пример работы с деревом: </h4>\n<code><span style="color: #ff0000;"><strong>\n&lt;?php</strong></span>\n<em><span style="color: #808080;">// функция построения узла</span></em>\n<strong><span style="color: #0000ff;">function</span></strong> createNode(<span style="color: #800000;">$tree</span> , <span style="color: #800000;">$parent</span>)\n{\n        <span style="color: #800000;">$s</span>='''';\n        <strong><span style="color: #0000ff;">if</span></strong>(!<span style="color: #800000;">$tree</span>-&gt;hasChilds(<span style="color: #800000;">$parent</span>))\n            <strong><span style="color: #0000ff;">return</span></strong> '''';\n         \n        <span style="color: #800000;">$childs</span> = <span style="color: #800000;">$tree</span>-&gt;getChilds(<span style="color: #800000;">$parent</span>);\n        <strong><span style="color: #0000ff;">foreach</span></strong> (<span style="color: #800000;">$childs</span> <strong><span style="color: #0000ff;">as</span></strong> <span style="color: #800000;">$k</span>=&gt;<span style="color: #800000;">$v</span>)\n        {\n                <span style="color: #800000;">$s</span>.=<span style="color: #339966;">''&lt;div style="padding-left: 15px;"&gt;\n                        &lt;div class="menuItem"&gt;\n                           &lt;a href="''</span>.<span style="color: #800000;">$v</span>[<span style="color: #339966;">''data''</span>][<span style="color: #339966;">''code''</span>].<span style="color: #339966;">''"&gt;''</span>.<span style="color: #800000;">$v</span>[<span style="color: #339966;">''data''</span>][<span style="color: #339966;">''title''</span>].<span style="color: #339966;">''&lt;/a&gt;\n                           &lt;p&gt;''</span>.<span style="color: #800000;">$v</span>[<span style="color: #339966;">''data''</span>][<span style="color: #339966;">''somedata''</span>].<span style="color: #339966;">''&lt;/p&gt;\n                        &lt;/div&gt;''</span>;\n                 \n                <strong><span style="color: #0000ff;">if</span></strong>(<span style="color: #800000;">$tree</span>-&gt;hasChilds(<span style="color: #800000;">$v</span>[<span style="color: #339966;">''id''</span>]))\n                        <span style="color: #800000;">$s</span>.=createNode(<span style="color: #800000;">$tree</span> , <span style="color: #993300;">$v</span>[<span style="color: #339966;">''id''</span>]);\n                 \n                <span style="color: #800000;">$s</span>.=<span style="color: #339966;">''&lt;/div&gt;''</span>;\n        }\n        <strong><span style="color: #0000ff;">return</span></strong> <span style="color: #800000;">$s</span>;\n}\n<em><span style="color: #808080;">// подготавливаем данные</span></em>\n<span style="color: #800000;">$data = <strong><span style="color: #0000ff;">array</span></strong><span style="color: #000000;">(\n</span></span>  <strong><span style="color: #0000ff;">array</span></strong>(<span style="color: #339966;">''id''</span>=&gt;<strong><span style="color: #ff0000;">1</span></strong>,<span style="color: #339966;">''code''</span>=&gt;<span style="color: #339966;">''index''</span>,<span style="color: #339966;">''parent''</span>=&gt;<strong><span style="color: #ff0000;">0</span></strong>,<span style="color: #339966;">''order''</span>=&gt;<strong><span style="color: #ff0000;">0</span></strong>,<span style="color: #339966;">''title''</span>=&gt;<span style="color: #339966;">''Main''</span>,<span style="color: #339966;">''somedata''</span>=&gt;<span style="color: #339966;">''text 1''</span>),\n  <strong><span style="color: #0000ff;">array</span></strong>(<span style="color: #339966;">''id''</span>=&gt;<strong><span style="color: #ff0000;">2</span></strong>,<span style="color: #339966;">''code''</span>=&gt;<span style="color: #339966;">''store''</span>,<span style="color: #339966;">''parent''</span>=&gt;<strong><span style="color: #ff0000;">0</span></strong>,<span style="color: #339966;">''order''</span>=&gt;<strong><span style="color: #ff0000;">1</span></strong>,<span style="color: #339966;">''title''</span>=&gt;<span style="color: #339966;">''Store''</span>,<span style="color: #339966;">''somedata''</span>=&gt;<span style="color: #339966;">''text 2''</span>),\n  <strong><span style="color: #0000ff;">array</span></strong>(<span style="color: #339966;">''id''</span>=&gt;<strong><span style="color: #ff0000;">3</span></strong>,<span style="color: #339966;">''code''</span>=&gt;<span style="color: #339966;">''catalog''</span>,<span style="color: #339966;">''parent''</span>=&gt;<strong><span style="color: #ff0000;">2</span></strong>,<span style="color: #339966;">''order''</span>=&gt;<strong><span style="color: #ff0000;">0</span></strong>,<span style="color: #339966;">''title''</span>=&gt;<span style="color: #339966;">''Store - Catalog''</span>,<span style="color: #339966;">''somedata''</span>=&gt;<span style="color: #339966;">''text 3''</span>),\n  <strong><span style="color: #0000ff;">array</span></strong>(<span style="color: #339966;">''id''</span>=&gt;<strong><span style="color: #ff0000;">4</span></strong>,<span style="color: #339966;">''code''</span>=&gt;<span style="color: #339966;">''goods''</span>,<span style="color: #339966;">''parent''</span>=&gt;<strong><span style="color: #ff0000;">2</span></strong>,<span style="color: #339966;">''order''</span>=&gt;<strong><span style="color: #ff0000;">1</span></strong>,<span style="color: #339966;">''title''</span>=&gt;<span style="color: #339966;">''Store - Catalog - Goods''</span>,<span style="color: #339966;">''somedata''</span>=&gt;<span style="color: #339966;">''text 4''</span>),\n  <strong><span style="color: #0000ff;">array</span></strong>(<span style="color: #339966;">''id''</span>=&gt;<strong><span style="color: #ff0000;">5</span></strong>,<span style="color: #339966;">''code''</span>=&gt;<span style="color: #339966;">''price''</span>,<span style="color: #339966;">''parent''</span>=&gt;<strong><span style="color: #ff0000;">4</span></strong>,<span style="color: #339966;">''order''</span>=&gt;<strong><span style="color: #ff0000;">2</span></strong>,<span style="color: #339966;">''title''</span>=&gt;<span style="color: #339966;">''Store - Catalog - Goods - Price''</span>,<span style="color: #339966;">''somedata''</span>=&gt;<span style="color: #339966;">''text 5''</span>),\n);\n\n<span style="color: #800000;">$tree</span> = <strong><span style="color: #0000ff;">new</span></strong> Tree();\n<em><span style="color: #808080;">// заполняем дерево данными</span></em>\n<strong><span style="color: #0000ff;">foreach</span></strong> (<span style="color: #800000;">$data</span> as <span style="color: #800000;">$item</span>)\n{\n        <span style="color: #800000;">$tree</span>-&gt;addItem(\n                        <span style="color: #800000;">$item</span>[<span style="color: #339966;">''id''</span>], \n                        <span style="color: #800000;">$item</span>[<span style="color: #339966;">''parent''</span>], \n                        <strong><span style="color: #0000ff;">array</span></strong>(\n                                <span style="color: #339966;">''title''</span>=&gt;<span style="color: #800000;">$item</span>[<span style="color: #339966;">''title''</span>] ,\n                                <span style="color: #339966;">''code''</span>=&gt; <span style="color: #800000;">$item</span>[<span style="color: #339966;">''code''</span>] ,\n                                <span style="color: #339966;">''somedata''</span>=&gt;<span style="color: #800000;">$item</span>[<span style="color: #339966;">''somedata''</span>]\n                        ),\n                        <span style="color: #800000;">$item</span>[<span style="color: #339966;">''order''</span>]\n        );\n}\n<em><span style="color: #808080;">// распечатываем дерево</span></em>\n<strong><span style="color: #0000ff;">echo</span></strong> createNode(<span style="color: #800000;">$tree</span> , <strong><span style="color: #ff0000;">0</span></strong>);\n</code>\n</pre>', 3, 'sysdocs_class', '206757987a242769a2fd5a4f85820c58', 1472),
('ru', 'description', 1380, 'Класс, отвечающий за работу с запросами к системе.', 3, 'sysdocs_class', 'fb0854e4b60979bdadd9f7d8ed7624ce', 1473),
('ru', 'description', 1381, 'PSR-0 Совместимый автозагрузчик классов', 3, 'sysdocs_class', '09e13bdeed5cbe48877a5ba2487c06c7', 1474),
('ru', 'description', 1382, '<p>Фабрика кэша</p>', 3, 'sysdocs_class', '331f387106d59033dc15d3ad2aeaa97f', 1475),
('ru', 'description', 1383, 'Интерфейс логирования', 3, 'sysdocs_class', 'e0beb5c813460c85bc49eb3f021d18ac', 1476),
('ru', 'description', 1386, 'Утилиты для работы со строками', 3, 'sysdocs_class', '7086d0d99ca2cd8d71786ac725fb6e9c', 1477),
('ru', 'description', 1387, 'Инетрфейс для классов валидации данных', 3, 'sysdocs_class', '71186d4b00726b2bf204c01a2bb131f6', 1478),
('ru', 'description', 1391, 'Валидатор Email адреса.', 3, 'sysdocs_class', '226a2fa9e344e85657da84c864944821', 1479),
('ru', 'description', 1395, '<p>Используется для рендеринга активных php-шаблонов (php-код смешанный с html).<br />\n<span style="color: #ff0000;">По умолчанию класс осуществляет кэширование результатов отработки на основе переданных данных.</span></p>\n\n<p>В классе определены магические методы&nbsp; __get&nbsp; и __set, &nbsp;передавать данные в шаблон можно простым обращением к свойству объекта. Внутри шаблона к данным можно обращаться с использованием конструкции $this-&gt;someKey.&nbsp;Стоит помнить о том, что вызов магических методов в PHP очень затратная операция, для получения максимальной производительности рекомендуем вам использовать прямой вызов методов &nbsp;get(), &nbsp;set() и setProperties().</p>', 3, 'sysdocs_class', '53a7d771ea4c0f59b24d07ef00834a15', 1480),
('ru', 'description', 1400, 'Фильтр данных', 3, 'sysdocs_class', '850900e045446852b76ae97e250f241c', 1481),
('ru', 'description', 1401, 'Интерфейс для хранилищ данных', 3, 'sysdocs_class', '04cba111f1f68bc711cb9efe3e64ebb2', 1482),
('ru', 'description', 1402, 'Хранилище данных на основе сессий', 3, 'sysdocs_class', '05fb30de60755a3d8dde4c10554be739', 1483),
('ru', 'description', 1406, 'Логирование сообщений в файл', 3, 'sysdocs_class', 'ed857bf55e1ef5b6f9be32183e799e30', 1484),
('ru', 'description', 1407, 'Фабрика объектов конфигурации', 3, 'sysdocs_class', '6f877ddeb01dba0d5d92b0fe4c41ec5b', 1485),
('ru', 'description', 1408, 'Модели в системе могут быть описаны только для существующих объектов ORM и имеют такое же имя.<br>\nМодели могут быть двух видов:\n<ul>\n    <li>виртуальная модель — для каждого объекта ORM есть виртуальная модель, содержащая стандартный набор методов (модель не существует в виде файла);</li>\n    <li>расширенная — модель, объявленная в виде класса, расширяющего функционал стандартной модели; в отличие от виртуальной может быть инстанцирована при помощи метода getInstance (класс должен быть отнаследован от класса Model).</li>\n</ul>\nБудьте предельно внимательны и осторожны при описании собственных моделей, система моделей использует позднее статическое связывание.\n\nСоздается модель конструкцией:\n\nModel::factory($objectName);\n\nДля расширенных моделей (реальных) так же возможна конструкция вида:\n\nModel_Page::getInstance();', 3, 'sysdocs_class', '0dbb9b4106f1cbdece7d733cd5e97ea8', 1486),
('ru', 'description', 1414, '<p>Объекты ORM &ndash; основополагающий класс для работы с данными ORM. После того, как описана структура объекта в ORM, данными объектов можно манипулировать при помощи класса Db_Object</p>\n\n<p>Пример: <code> </code></p>\n\n<pre>\n<code>\n  <span style="color:#8B4513;">$news</span> = <strong><span style="color:#0000FF;">new </span></strong>Db_Object(<span style="color:#008000;">&#39;news&#39;</span>);\n  <span style="color:#8B4513;">$news</span>-&gt;title = <span style="color:#008000;">&#39;Новость 1&#39;</span>;\n  <span style="color:#8B4513;">$news</span>-&gt;text = <span style="color:#008000;">&#39;Содержание новости&#39;</span>;\n  <span style="color:#8B4513;">$news</span>-&gt;news_date = date(<span style="color:#008000;">&#39;Y-m-d&#39;</span>);\n  <span style="color:#8B4513;">$news</span>-&gt;save();\n</code></pre>\n\n<p>Как видно из примера, свойства (поля) объекта назначаются стандартным сеттером. В случае если мы пытаемся указать несуществующее свойство или задать значение, неудовлетворяющее указанному в конфигурации типу, будет брошен Exception. Сохранение данных производится путем вызова метода save.</p>', 3, 'sysdocs_class', 'c21295403ac5daf60f791b585dd134fe', 1487),
('ru', 'description', 1415, '<p>Строитель запросов на основе структуры&nbsp; ORM, системный класс используется в модуле&nbsp; Reports</p>', 3, 'sysdocs_class', '3bfd91ac3129d3bc1e3e8cbc6e7ed0ba', 1488),
('ru', 'description', 1416, '<p>Интерфейс менеджера подключений к базам данных</p>\n', 3, 'sysdocs_class', '366606ba0611143017e8487fd17080a9', 1489),
('ru', 'description', 1417, '<p>Фильтр для построения запросов, используется в контроллерах для более гибкой настройки выборок из моделей при помощи метода&nbsp; getList</p>\n\n<p>Пример:</p>\n\n<pre>\n<code>\n<span style="color:#800000">$filters</span> = <span style="color:#0000FF"><strong>array</strong></span>(\n <span style="color:#0000FF"><strong>new</strong></span> Db_Select_Filter(<span style="color:#008000">&#39;id&#39;</span> , <span style="color:#0000FF"><strong>array</strong></span>(<span style="color:#FF0000;">1</span>,<span style="color:#FF0000;">2</span>,<span style="color:#FF0000;">3</span>,<span style="color:#FF0000;">4</span>),Db_Select_Filter::NOT_IN),\n <span style="color:#0000FF"><strong>new</strong></span> Db_Select_Filter(<span style="color:#008000">&#39;id&#39;</span> , <span style="color:#B22222;">10</span> , Db_Select_Filter::LT),\n);\n<span style="color:#800000">$data</span> = Model::factory(<span style="color:#008000">&#39;User&#39;</span>)-&gt;getList(<span style="color:#0000FF"><strong>false</strong></span> , <span style="color:#800000">$filters</span>);\n</code></pre>', 3, 'sysdocs_class', '63e6b5a9236e43225a87953f1fe17b08', 1490),
('ru', 'description', 1418, '<p>Класс построения SQL запросов для выборки данных (select).<br />\nПредставляет из себя реализацию интерфейса Zend_Db_Select, отличается упрощенной логикой и большей производительностью.<br />\nПоведение практически идентичное&nbsp;Zend_Db_Select.</p>', 3, 'sysdocs_class', '38cc204a2ed70651062601d333df6011', 1491),
('ru', 'description', 1419, '<p>Адаптер подключения к бд&nbsp; MySQL&nbsp; с использованием&nbsp; Mysqli, расширяет класс&nbsp; Zend Framework 1.x.</p>\n\n<p>Добавлен хэндлер ошибок, улучшена производительность. Облегчен функционал</p>', 3, 'sysdocs_class', 'ecc04a75d4bfb387ff22cb3f2a6a3aa4', 1492),
('ru', 'description', 1420, '<p>Адаптер хранилища объектов Db_Object. Системный класс. Используется для отправки данных в БД<br />\n&nbsp;</p>', 3, 'sysdocs_class', '91dfee2ce858ac3436e1d2bf0b4d99b3', 1493),
('ru', 'description', 1421, '<p><span class="st"><em>Access Control List</em>&nbsp; </span>на&nbsp; уровне доспа к объекту&nbsp; ORM</p>', 3, 'sysdocs_class', '4ef7bce4bfdcd4ac5e6eb1f4621c42bd', 1494),
