('ru', 'description', 1428, '<p>Хелпер, хранящий структуру данных&nbsp; Db_Object, используется для получения детализированной информации о структуре объекта, содержит системные свойства для управления структурой объекта (используются административным интерфейсом).</p>', 3, 'sysdocs_class', '23731e87a99120d00ad81de364adf36f', 1500),
