('ru', 'description', 1433, '<p>Класс Security_Csrf используется для создания, управления и валидации токенов, направленных на защиту от CSRF-атак.</p>\n<p><strong>Простой пример проверки токена:</strong></p>\n<pre><code>\n<span style="color: #6a310a;">$csrf </span>= <span style="color: #0000ff;"><strong>new </strong></span>Security_Csrf();\n<span style="color: #3f55bf;">/*</span>\n<span style="color: #3f55bf;"> * Устанавливаем опции токена</span>\n<span style="color: #3f55bf;"> * lifetime — время жизни 1 час</span>\n<span style="color: #3f55bf;"> * cleanupLimit — лимит накопления токенов в хранилище, при котором начнется</span>\n<span style="color: #3f55bf;"> * очистка устаревших токенов (текущего пользователя)</span>\n<span style="color: #3f55bf;"> * storage — хранилище токенов, по умолчанию — сессия, оставим без изменений</span>\n<span style="color: #3f55bf;"> */</span>\n<span style="color: #6a310a;">$csrf</span>-&gt;setOptions(\n<span style="color: #0000ff;"><strong>     array</strong></span><strong></strong>(\n<span style="color: #008000;">          ''lifetime''</span> =&gt; 3600,\n<span style="color: #008000;">          ''cleanupLimit''</span> =&gt; 300\n     )\n);\n<span style="color: #3f55bf;">// Проверяем наличие токена в заголовках данных POST запроса, в данном случае AJAX</span>\n<span style="color: #0000ff;"><strong>if</strong></span>(!<span style="color: #6a310a;">$csrf</span>-&gt;checkHeader() &amp;&amp; !<span style="color: #6a310a;">$csrf</span>-&gt;checkPost())\n   Response::<em>jsonError</em>(<span style="color: #008000;">''Error Message''</span>);\n</code></pre>', 3, 'sysdocs_class', '8cd2d3b18ca33e0114b2dee8b9c1376d', 1503),
