('ru', 'description', 17681, 'Перевести массив в список целочисленных значений для вставки в условия SQL-запроса, используется для увеличения производительности подготовки запросов на основе Zend_Select', 3, 'sysdocs_class_method', 'a80e67282a399f5d61a68f7fee5ee1a0', 1855),
