('ru', 'description', 17683, 'Получить список записей (используется контроллерами CRUD_VC)<br>\n$params  - параметры array(''start''=>0,''limit''=>10,''sort''=>''fieldname'',''dir''=>''DESC'')<br>\n$filters - фильтры<br>\n$query - строка для поиска<br>\n$fields - список полей<br>\n$author -l ключ для хранения ID автора записи<br>\n$lastEditor  - ключ для хранения ID последнего редактора<br>\n $joins - конфиг включений для Zend_Select:<br>\n<code>\n<pre>\n  array(\n           array(\n                 ''joinType''=>   joinLeft/left , joinRight/right , joinInner/inner\n                 ''table'' => array / string\n                 ''fields => array / string\n                 ''condition''=> string\n           )...\n  )\n</pre>\n</code>', 3, 'sysdocs_class_method', '1885bae9e4ec00e486d3654e39ec07be', 1857),
('ru', 'description', 17684, 'Подготовка фильтров запроса. Удаление пустых фильтров', 3, 'sysdocs_class_method', '41325825e7412cdc1cad1dd3d227bfd0', 1858),
('ru', 'description', 17685, 'Системный метод получения данных в рамках одной базы данных', 3, 'sysdocs_class_method', '7e7383c46a1004ef9ac6300d1a959d4e', 1859),
('ru', 'description', 17686, 'Системный метод получения данных для объектов находящихся в разных базах данных', 3, 'sysdocs_class_method', 'cb44c522a895b954c62a42c30b30634c', 1860),
('ru', 'description', 17687, 'Получить список записей\n $params - параметры array(''start''=>0,''limit''=>10,''sort''=>''fieldname'',''dir''=>''DESC'') <br>\n$filters  -  фильтры (where) ключ — имя поля, значение <br>\n $fields -   список полей для выборки <br>\n$useCache - использовать жесткое кэширование <br>\n<br>\nНеобходимо помнить, что жесткий кэш инвалидируется только по истечению времени жизни (configs/main.php),\n  используется в случае неприменимости триггеров изменений', 3, 'sysdocs_class_method', '2c42726fd7a7bf9156bcfbb2387a5776', 1861),
