('ru', 'description', 17811, 'Добавить в запрос условие DISTINCT \n\n<pre style="padding-left: 30px;"><code><span style="color: #008000;">\n    SELECT DISTINCT `table`.* FROM `table`;</span>\n    <span style="color: #993300;">$sql</span> = <strong><span style="color: #0000ff;">new </span></strong>Db_Select();\n    <span style="color: #993300;">$sql</span>-&gt;from(<span style="color: #3f55bf;">''table''</span>)-&gt;distinct();\n</code></pre>', 3, 'sysdocs_class_method', '4dc62ad45f3fd3676fc0573f626a1890', 1906),
('ru', 'description', 17812, 'Добавить в запрос условие FROM \n<pre><code><span style="color: #993300;">\n    $sql</span> = <strong><span style="color: #0000ff;">new </span></strong>Db_Select();\n\n1)\n    <span style="color: #008000;">SELECT `table`.`id`, `table`.`name`, `table`.`date` FROM `table`;</span>\n    <span style="color: #993300;">$sql</span>-&gt;from(<span style="color: #3f55bf;">''table''</span>,<span style="color: #3f55bf;">''id,name,date''</span>);\n\n2)\n    <span style="color: #008000;">SELECT `table`.`id`, `table`.`title`, `table`.`name` FROM `table`;</span>\n    <span style="color: #993300;">$sql</span>-&gt;from(<span style="color: #3f55bf;">''table''</span>, <strong><span style="color: #0000ff;">array</span></strong>(<span style="color: #3f55bf;">''id''</span>,<span style="color: #3f55bf;">''title''</span>,<span style="color: #3f55bf;">''name''</span>));\n   \n3)\n    <span style="color: #008000;">SELECT COUNT(*) AS `count`, `table`.`name` AS `field_name`, `table`.`order` FROM `table`;</span>\n    <span style="color: #993300;">$sql</span>-&gt;from(<span style="color: #3f55bf;">''table''</span>, <strong><span style="color: #0000ff;">array</span></strong>(\n               <span style="color: #3f55bf;">''count''</span>=&gt;<span style="color: #3f55bf;">''COUNT(*)''</span>,\n               <span style="color: #3f55bf;">''field_name''</span>=&gt;<span style="color: #3f55bf;">''name''</span>,\n               <span style="color: #3f55bf;">''order''</span>\n              )\n    );\n   \n4)\n    <span style="color: #008000;">SELECT COUNT(*) AS `count`, `t`.`name` AS `field_name`, `t`.`order` FROM `some_table` AS `t`;</span>\n    <span style="color: #993300;">$sql</span>-&gt;from(\n        <strong><span style="color: #0000ff;">array</span></strong>(<span style="color: #3f55bf;">''t''</span>=&gt;<span style="color: #3f55bf;">''some_table''</span>),                     \n        <strong><span style="color: #0000ff;">array</span></strong>(\n            <span style="color: #3f55bf;">''count''</span>=&gt;<span style="color: #3f55bf;">''COUNT(*)''</span>,\n            <span style="color: #3f55bf;">''field_name''</span>=&gt;<span style="color: #3f55bf;">''name''</span>,\n            <span style="color: #3f55bf;">''order''</span>\n            )\n        );\n</code>\n</pre>', 3, 'sysdocs_class_method', 'e0fad4fa13da638263f70812619d0b6d', 1907),
('ru', 'description', 17813, 'Добавить в запрос условие WHERE \n<pre style="padding-left: 30px;"><code><span style="color: #993300;">\n    $sql</span> = new Db_Select();\n\n1)\n    <span style="color: #008000;">SELECT `table`.* FROM `table` WHERE (`id` =7) ORDER BY `name` DESC;</span>\n    <span style="color: #993300;">$sql</span>-&gt;from(<span style="color: #3f55bf;">''table''</span>)-&gt;where(<span style="color: #3f55bf;">''`id` =?''</span>,<span style="color: #ff0000;">7</span>)-&gt;order(<span style="color: #3f55bf;">''name DESC''</span>);\n   \n2)\n    <span style="color: #008000;">SELECT `table`.* FROM `table` WHERE (`id` =0.600000) ORDER BY `name` DESC;</span>\n    <span style="color: #993300;">$sql</span>-&gt;from(<span style="color: #3f55bf;">''table''</span>)-&gt;where(<span style="color: #3f55bf;">''`id` =?''</span>,<span style="color: #ff0000;">0.6</span>)-&gt;order(<span style="color: #3f55bf;">''name DESC''</span>);\n   \n3)\n    <span style="color: #008000;">SELECT `table`.* FROM `table` WHERE (`code` =''code'') ORDER BY `name` DESC;</span>\n    <span style="color: #993300;">$sql</span>-&gt;from(<span style="color: #3f55bf;">''table''</span>)-&gt;where(<span style="color: #3f55bf;">''`code` =?''</span>,<span style="color: #3f55bf;">''code''</span>)-&gt;order(<span style="color: #3f55bf;">''name DESC''</span>);\n\n4)\n    <span style="color: #008000;">SELECT `table`.* FROM `table` WHERE (`code` IN(''first'',''second'')) ORDER BY `name` DESC;</span>\n\n    <span style="color: #993300;">$sql</span>-&gt;from(<span style="color: #3f55bf;">''table''</span>)\n    -&gt;where(<span style="color: #3f55bf;">''`code` IN(?)''</span>,<strong><span style="color: #0000ff;">array</span></strong>(<span style="color: #3f55bf;">''first''</span>,<span style="color: #3f55bf;">''second''</span>))\n    -&gt;order(<span style="color: #3f55bf;">''name DESC''</span>);\n\n5)\n    <span style="color: #008000;">SELECT `table`.* FROM `table` WHERE (`id` IN(7,8,9)) ORDER BY `name` DESC;</span>\n    <span style="color: #993300;">$sql</span>-&gt;from(<span style="color: #3f55bf;">''table''</span>)-&gt;where(<span style="color: #3f55bf;">''`id` IN(?)''</span>,<strong><span style="color: #0000ff;">array</span></strong>(<span style="color: #ff0000;">7</span>,<span style="color: #ff0000;">8</span>,<span style="color: #ff0000;">9</span>))-&gt;order(<span style="color: #3f55bf;">''name DESC''</span>);\n</code></pre>', 3, 'sysdocs_class_method', '5e9f3c1437ee7d1da6befbf3fa8c81ff', 1908),
('ru', 'description', 17814, 'Добавить в запрос условие OR WHERE \n<pre style="padding-left: 30px;"><code><span style="color: #008000;">\n    SELECT `table`.*\n    FROM `table`\n    WHERE\n        (`id` =7 AND `code` =''code'')\n    OR\n        (`id` =8 )\n    OR\n        (`id` =9);</span>\n\n    <span style="color: #993300;">$sql</span> = <strong><span style="color: #0000ff;">new </span></strong>Db_Select();<br> <br>   &nbsp;<span style="color: #993300;">$sql</span>-&gt;from(<span style="color: #3f55bf;">''table''</span>)\n    -&gt;where(<span style="color: #3f55bf;">''`id` =?''</span>,<span style="color: #ff0000;">7</span>)\n    -&gt;where(<span style="color: #3f55bf;">''`code` =?''</span>,<span style="color: #3f55bf;">"code"</span>)\n    -&gt;orWhere(<span style="color: #3f55bf;">''`id` =?''</span>,<span style="color: #ff0000;">8</span>)\n    -&gt;orWhere(<span style="color: #3f55bf;">''`id` =?''</span>,<span style="color: #ff0000;">9</span>);\n</code></pre>', 3, 'sysdocs_class_method', '1b0c317f5a478ad4557ceb8fe97f0225', 1909),
('ru', 'description', 17815, 'Добавить в запрос условие GROUP \n<pre style="padding-left: 30px;"><code><span style="color: #993300;">\n     $sql</span> = <strong><span style="color: #0000ff;">new </span></strong>Db_Select();\n\n1)   \n     <span style="color: #008000;">SELECT `table`.* FROM `table` GROUP BY `type`,`cat`;</span>\n     <span style="color: #993300;">$sql</span>-&gt;from(<span style="color: #3f55bf;">''table''</span>)-&gt;group(array(<span style="color: #3f55bf;">''type''</span>,<span style="color: #3f55bf;">''cat''</span>));\n       \n2)   \n     <span style="color: #008000;">SELECT `table`.* FROM `table` GROUP BY `type`;</span>   \n     <span style="color: #993300;">$sql</span>-&gt;from(<span style="color: #3f55bf;">''table''</span>)-&gt;group(<span style="color: #3f55bf;">''type''</span>);\n3)\n     <span style="color: #008000;">SELECT `table`.* FROM `table` GROUP BY `type`,`cat`;</span>\n     <span style="color: #993300;">$sql</span>-&gt;from(<span style="color: #3f55bf;">''table''</span>)-&gt;group(<span style="color: #3f55bf;">''type,cat''</span>);\n</code></pre>', 3, 'sysdocs_class_method', 'c757e518ae751042a70c29a78de82cb9', 1910),
('ru', 'description', 17816, 'Добавить в запрос условие HAVING \n<pre style="padding-left: 30px;"><code><span style="color: #008000;">\n    SELECT CONCAT(code,"i") AS `c_code` FROM `sb_content` HAVING (`c_code` =''index'');</span>\n    <span style="color: #993300;">$sql</span> = <strong><span style="color: #0000ff;">new </span></strong>Db_Select();\n    <span style="color: #993300;">$sql</span>-&gt;from(<span style="color: #3f55bf;">''sb_content''</span> , <strong><span style="color: #0000ff;">array</span></strong>(<span style="color: #3f55bf;">''c_code''</span>=&gt;<span style="color: #3f55bf;">''CONCAT(code,"i")''</span>))\n        -&gt;having(<span style="color: #3f55bf;">''`c_code` =?''</span>,<span style="color: #3f55bf;">"index"</span>);\n</code></pre>', 3, 'sysdocs_class_method', '79bdb55cfd2da71bc878334a859a5f17', 1911),
('ru', 'description', 17817, 'Добавить в запрос условие OR HAVING \n<pre style="padding-left: 30px;"><code><span style="color: #008000;">\n    SELECT CONCAT(code,"i") AS `c_code` FROM `sb_content` HAVING (`c_code` =''index'') OR (`c_code` =''articles'');</span>\n\n    <span style="color: #993300;">$sql</span> = <strong><span style="color: #0000ff;">new </span></strong>Db_Select();\n    <span style="color: #993300;">$sql</span>-&gt;from(<span style="color: #3f55bf;">''sb_content''</span> , <strong><span style="color: #0000ff;">array</span></strong>(<span style="color: #3f55bf;">''c_code''</span>=&gt;<span style="color: #3f55bf;">''CONCAT(code,"i")''</span>))\n     -&gt;having(<span style="color: #3f55bf;">''`c_code` =?''</span>,<span style="color: #3f55bf;">"index"</span>)\n     -&gt;orHaving(<span style="color: #3f55bf;">''`c_code` =?''</span>,<span style="color: #3f55bf;">"articles"</span>);\n</code></pre>', 3, 'sysdocs_class_method', '91ebfd66a0642d5d4cc411b1a0489555', 1912),
('ru', 'description', 17818, 'Добавить другую таблицу используя объединение JOIN \n<pre style="padding-left: 30px;"><code><span style="color: #008000;">\n    SELECT `a`.*, `b`.`title`, `b`.`time` FROM `table` AS `a` INNER JOIN `table2` AS `b` ON a.code = b.id;</span>\n    <span style="color: #993300;">$sql</span> = <strong><span style="color: #0000ff;">new </span></strong>Db_Select();\n    <span style="color: #993300;">$sql</span>-&gt;from(<strong><span style="color: #0000ff;">array</span></strong>(<span style="color: #3f55bf;">''a''</span>=&gt;<span style="color: #3f55bf;">''table''</span>))\n        -&gt;join(\n                <strong><span style="color: #0000ff;">array</span></strong>(<span style="color: #3f55bf;">''b''</span>=&gt;<span style="color: #3f55bf;">''table2''</span>),\n                <span style="color: #3f55bf;">''a.code = b.id''</span>,\n                <strong><span style="color: #0000ff;">array</span></strong>(<span style="color: #3f55bf;">''title''</span>,<span style="color: #3f55bf;">''time''</span>)\n        );\n</code></pre>', 3, 'sysdocs_class_method', '9a45cb04a3aa0ed79b129c4dea61e9e7', 1913),
('ru', 'description', 17819, 'Добавить другую таблицу используя объединение INNER JOIN \n<pre style="padding-left: 30px;"><code><span style="color: #008000;">\n    SELECT `a`.*, `b`.`title`, `b`.`time`, `c`.`title` AS `ctitle`, `c`.`time` AS `ctime`\n    FROM\n        `table` AS `a`\n    INNER JOIN `table2` AS `b` ON a.code = b.id\n    INNER JOIN `table3` AS `c` ON b.code = c.id;</span>\n\n    <span style="color: #993300;">$sql</span> = <strong><span style="color: #0000ff;">new </span></strong>Db_Select();\n    <span style="color: #993300;">$sql</span>-&gt;from(<strong><span style="color: #0000ff;">array</span></strong>(<span style="color: #3f55bf;">''a''</span>=&gt;<span style="color: #3f55bf;">''table''</span>))\n    -&gt;joinInner(\n                <strong><span style="color: #0000ff;">array</span></strong>(<span style="color: #3f55bf;">''b''</span>=&gt;<span style="color: #3f55bf;">''table2''</span>),\n                <span style="color: #3f55bf;">''a.code = b.id''</span>,\n                <strong><span style="color: #0000ff;">array</span></strong>(<span style="color: #3f55bf;">''title''</span>,<span style="color: #3f55bf;">''time''</span>)\n        )\n     -&gt;joinInner(\n                <strong><span style="color: #0000ff;">array</span></strong>(<span style="color: #3f55bf;">''c''</span>=&gt;<span style="color: #3f55bf;">''table3''</span>),\n                <span style="color: #3f55bf;">''b.code = c.id''</span>,\n                <strong><span style="color: #0000ff;">array</span></strong>(<span style="color: #3f55bf;">''ctitle''</span>=&gt;<span style="color: #3f55bf;">''title''</span>,<span style="color: #3f55bf;">''ctime''</span>=&gt;<span style="color: #3f55bf;">''time''</span>)\n        );\n   \n   </code></pre>', 3, 'sysdocs_class_method', '30ca48a21373194b8f38b2b369b4e3b9', 1914),
('ru', 'description', 17820, 'Добавить другую таблицу используя объединение LEFT JOIN', 3, 'sysdocs_class_method', '6fbded9d434798dc76dc5271eeea8cf4', 1915),
