('ru', 'description', 17823, 'Добавить в запрос условие LIMIT \n<pre style="padding-left: 30px;"><code><span style="color: #993300;">\n    $sql</span> = <strong><span style="color: #0000ff;">new </span></strong>Db_Select();\n1)\n    <span style="color: #008000;">SELECT `table`.* FROM `table` LIMIT 20,10;</span>\n    <span style="color: #993300;">$sql</span>-&gt;from(<span style="color: #3f55bf;">''table''</span>)-&gt;limit(<span style="color: #ff0000;">10</span> ,<span style="color: #ff0000;">20</span>);\n       \n2)               \n    <span style="color: #008000;">SELECT `table`.* FROM `table` LIMIT 10;</span>\n    <span style="color: #993300;">$sql</span>-&gt;from(<span style="color: #3f55bf;">''table''</span>)-&gt;limit(<span style="color: #ff0000;">10</span>);\n       \n</code></pre>', 3, 'sysdocs_class_method', 'd587cf970655b6f32f524ce553bd6385', 1917),
('ru', 'description', 17824, 'Устанавливаем limit и count исходя из номера страницы. \n<pre style="padding-left: 30px;"><code><span style="color: #008000;">\n    SELECT `table`.* FROM `table` LIMIT 30,10;</span>\n    <span style="color: #993300;">$sql</span> = <strong><span style="color: #0000ff;">new </span></strong>Db_Select();\n    <span style="color: #993300;">$sql</span>-&gt;from(<span style="color: #3f55bf;">''table''</span>)-&gt;limitPage(<span style="color: #ff0000;">4</span>, <span style="color: #ff0000;">10</span>);\n</code></pre>', 3, 'sysdocs_class_method', '62366950607c58e5284983a2e853efa7', 1918),
('ru', 'description', 17825, 'Добавить в запрос условие ORDER \n<pre style="padding-left: 30px;"><code><span style="color: #993300;">  \n    $sql</span> = new Db_Select();\n\n1)\n    <span style="color: #008000;">SELECT `table`.* FROM `table` ORDER BY `name` DESC,`group` ASC;</span>\n    <span style="color: #993300;">$sql</span>-&gt;from(<span style="color: #3f55bf;">''table''</span>)-&gt;order(<strong><span style="color: #0000ff;">array</span></strong>(<span style="color: #3f55bf;">''name''</span>=&gt;<span style="color: #3f55bf;">''DESC''</span>,<span style="color: #3f55bf;">''group''</span>=&gt;<span style="color: #3f55bf;">''ASC''</span>));\n\n2)\n    <span style="color: #008000;">SELECT `table`.* FROM `table` ORDER BY `name`,`group`;</span>\n    <span style="color: #993300;">$sql</span>-&gt;from(<span style="color: #3f55bf;">''table''</span>)-&gt;order(<strong><span style="color: #0000ff;">array</span></strong>(<span style="color: #3f55bf;">''name''</span>,<span style="color: #3f55bf;">''group''</span>));\n       \n3)\n    <span style="color: #008000;">SELECT `table`.* FROM `table` ORDER BY name ASC,group DESC;</span>\n    <span style="color: #993300;">$sql</span>-&gt;from(<span style="color: #3f55bf;">''table''</span>)-&gt;order(<strong><span style="color: #0000ff;">array</span></strong>(<span style="color: #3f55bf;">''name ASC''</span>,<span style="color: #3f55bf;">''group DESC''</span>));\n               \n4)\n    <span style="color: #008000;">SELECT `table`.* FROM `table` ORDER BY `name` DESC,`group` ASC;</span>\n    <span style="color: #993300;">$sql</span>-&gt;from(<span style="color: #3f55bf;">''table''</span>)-&gt;order(<span style="color: #3f55bf;">''name DESC, group ASC''</span>);\n\n5)\n    <span style="color: #008000;">SELECT `table`.* FROM `table` ORDER BY `name` DESC;</span>\n    <span style="color: #993300;">$sql</span>-&gt;from(<span style="color: #3f55bf;">''table''</span>)-&gt;order(<span style="color: #3f55bf;">''name DESC''</span>);\n   </co